  projectId: "samplereactproject-e5f3c",
  storageBucket: "samplereactproject-e5f3c.appspot.com",
  messagingSenderId: "120610836238",
  appId: "1:120610836238:web:b177184acc0b403bd2d15f",
  measurementId: "G-VW00EVENWF",
};

// Initialize Firebase
const app = initializeApp(firebaseConfig);
const auth = getAuth(app);
const db = getFirestore(app);
const storage = getStorage(app);

export { auth, db, storage };
